import React from 'react';
import { View, Text, StyleSheet, Button } from 'react-native';
 
const styles = StyleSheet.create({
    container: {
      flex: 1,
        flexDirection: 'column',
        justifyContent: 'center',
        marginLeft: '10%',
        marginRight: '10%'
  },
  buttonStyle: {
        padding: 10,
  }
  });

const HomeScreen = ({ navigation }) => {
    return (
        <View style={styles.container}>
            <View style={styles.buttonStyle}>
                <Button
                title= 'Map'
                color= 'blue'
                fontWeight = 'bold'
                onPress = {() => alert(1) }
                />
            </View>
            <View style={styles.buttonStyle}>
                <Button
                title= 'Calendar'
                color= 'orange'
                fontWeight = 'bold'
                onPress = {() => alert(2)}
                />
            </View>
            <View style={styles.buttonStyle}>
                <Button
                title= 'About us'
                color= 'blue'
                fontWeight = 'bold'
                onPress = {() => alert(3) }
                />
            </View>
            <View style={styles.buttonStyle}>
                <Button
                title= 'Events'
                color= 'orange'
                fontWeight = 'bold'
                onPress = {() => alert(2)}
                />
            </View>
            <View style={styles.buttonStyle}>
                <Button
                title= 'Contact Us'
                color= 'blue'
                fontWeight = 'bold'
                onPress = {() => alert(2)}
                />
            </View>
            <View style={styles.buttonStyle}>
                <Button
                title= 'Schedule Tour'
                color= 'orange'
                fontWeight = 'bold'
                onPress = {() => alert(2)}
                />
            </View>
        </View>
    );
  };

export default HomeScreen;
